'use strict';

var printModel = function ( title, url, images, hero, navContainer, navPanel, tabContainer, tabPanel, businessFunction, publicationDate, providerName, providerColor, tileLogo ) {
	this.title = title;
	this.url = url;
	this.images = images;
	this.hero = hero;
	this.navContainer = navContainer;
	this.tabContainer = tabContainer;
	this.navPanel = navPanel;
	this.tabPanel = tabPanel;
	this.businessFunction = businessFunction;
	this.publicationDate = publicationDate;
	this.providerName = providerName;
	this.providerColor = providerColor;
	this.tileLogo = tileLogo;
};

module.exports = printModel;